import { mapGetters } from 'vuex'
export default {
  name: 'Record',
  data() {
    return {
      data:[],
      timer:null
    }
  },
  created() {
    this.requestData()
    this.timer=setInterval(this.requestData,5000)
  },
  methods: {
    requestData() {
      getOrder().then(res =>{
        this.data=res.data
      })
    },
  },
  beforeDestroy() {
    clearInterval(this.timer);
    this.timer = null;
}

